import React, {Component} from "react";
import Social from '../components/Social';
// import profilepic from '../img/profiled'
import ReactTypingEffect from 'react-typing-effect'

class Home extends Component{
    render(){
        return(
            <div className="condiv home">
                <img src="https://scontent.fbkk5-1.fna.fbcdn.net/v/t1.6435-9/196988275_4082586345162043_2435991669191098824_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=174925&_nc_eui2=AeFr5ilSOH5X2dsGziTjbSiHF-aryTb3K90X5qvJNvcr3Q0U6ihqHon_fasVj0CJvSHZSaPS91do4aCdz8XudonL&_nc_ohc=ToNTw433bs4AX-t_hun&_nc_ht=scontent.fbkk5-1.fna&oh=00_AT9ra_QuREve9g4a47rt_YeZEbcMjDdZYK7PJ6DNWESI9w&oe=626A690E" alt="profile" className="profilepic"/>
                <ReactTypingEffect text={['I am Jakkirt.','My Profile.']} speed={80} eraseDelay={200} className="typingeffect"/>
                <Social />
            </div>
        );
    }
}

export default Home;
